(function execute(inputs, outputs) {
	var utils = new AzureAutomationUtils();
    utils.validateInputVariables(inputs, outputs);
    utils.validateMandatoryVariables(inputs, ['subscription_id', 'resource_group_name','account_name','job_schedule_id']);
    utils.mapToOutputFromInput(inputs, outputs, ['subscription_id', 'resource_group_name','account_name','job_schedule_id']);
})(inputs, outputs);

